import Foundation
import ArgumentParser
import Framework

struct BenchmarkCommand: ParsableCommand {
    static let configuration = CommandConfiguration(
        commandName: "benchmark"
    )

    let numberOfVertices: Int = 10
    let nestingRatio: Double = 0.0
    let nestingBias: Double = 0.0
    let numberOfOptimizationSteps: Int = 100

    func run() throws {
        let before = CFAbsoluteTimeGetCurrent()
        let generator = DelaunayGraphGenerator(numberOfCountries: self.numberOfVertices, nestingRatio: self.nestingRatio, nestingBias: self.nestingBias)

        let uuid = UUID(uuidString: "0AC1479B-72F0-43C1-A386-B84B294AB19C")!

        var hasher = Hasher()
        hasher.combine(uuid.uuidString)
        hasher.combine(self.numberOfVertices)
        hasher.combine(self.nestingRatio)
        hasher.combine(self.nestingBias)
        let seed = UInt64(bitPattern: Int64(hasher.finalize()))

        var pipeline = Pipeline(seed: seed, generator: generator)
        print(pipeline.data == cluster0)
        for _ in 0..<self.numberOfOptimizationSteps { pipeline.step() }
        print(pipeline.data == cluster1)
        pipeline.transform()
        print(pipeline.data == map0)
        for _ in 0..<self.numberOfOptimizationSteps { pipeline.step() }
        print(pipeline.data == map1)
        for _ in 0..<10 {
            pipeline.applyRandomOperation()
            for _ in 0..<self.numberOfOptimizationSteps { pipeline.step() }
        }
        print(pipeline.data == map11)
        for _ in 0..<10 {
            pipeline.applyRandomOperation()
            for _ in 0..<self.numberOfOptimizationSteps { pipeline.step() }
        }
        print(pipeline.data == map21)

        let after = CFAbsoluteTimeGetCurrent()
        print(after - before)
    }
}


